// Function to dynamically create product tiles
function generateProductTiles() {
    const productContainer = document.getElementById('product-container');

    crops.forEach((crop) => {
        const productTile = `
            <div class="product-tile">
                <img src="${crop.image}" alt="${crop.name}" class="product-image">
                <div class="product-info">
                    <h3 class="product-name"><span class="star-symbol">★</span>${crop.name}</h3>
                    <p class="product-price">${crop.price}</p>
                    <div class="button-group">
                        <button class="details-btn" onclick="showDetails('${crop.name}')">Details</button>
                        <button class="add-to-cart-btn" onclick="addToCart('${crop.name}')">Add to Cart</button>
                    </div>
                </div>
            </div>
        `;
        productContainer.innerHTML += productTile;
    });
}

// Function to show details in a modal
function showDetails(productName) {
    const modal = document.getElementById('detailsModal');
    const modalTitle = document.getElementById('modal-title');
    const modalDescription = document.getElementById('modal-description');
    const modalFarmerDetails = document.getElementById('modal-farmer-details');
    const modalLocation = document.getElementById('modal-location');

    const crop = crops.find((crop) => crop.name === productName);

    modalTitle.innerText = crop.name;
    modalDescription.innerText = crop.description;
    modalFarmerDetails.innerText = `Farmer: ${crop.farmer}`;
    modalLocation.innerText = `Location: ${crop.location}`;

    modal.style.display = 'flex';
}

function closeModal() {
    document.getElementById('detailsModal').style.display = 'none';
}

function addToCart(productName) {
    alert(productName + " has been added to your cart.");
}

// Generate the product tiles when the page loads
document.addEventListener('DOMContentLoaded', generateProductTiles);


